INSERT INTO `CYCategories` VALUES (1000,'An.1','16bitSubsystem','Anomalies','This object utilizes the 16 bit subsystem. Malware uses this to exist in a less secure and less monitored part of the operating system, and frequently to perform privilege escalation attacks','2020-08-19 15:43:19',NULL),(1001,'An.2','Anachronism','Anomalies','This PE appears to be lying about when it was written, which is atypical for professionally written software','2020-08-19 15:43:19',NULL),(1002,'An.3','AppendedData','Anomalies','This PE has some extra content appended to it, beyond the normal areas of the file. Appended data can frequently be used to embed malicious code or data and is frequently overlooked by protection systems','2020-08-19 15:43:19',NULL),(1003,'An.4','Base64Alphabet','Anomalies','This object contains evidence of usage of BASE64 Encoding of an alphabet. Malware does this to attempt to avoid common detection, or to attack other programs using BASE64 encoding','2020-08-19 15:43:19',NULL),(1004,'An.5','CommandlineArgsImport','Anomalies','This sample imports functions that can be used to read arguments from a command line. Malware uses this to collect information on subsequent runs','2020-08-19 15:43:19',NULL),(1005,'An.6','ManifestMismatch','Anomalies','This object demonstrates an inconsistency in its manifest. Malware does this to avoid detection, but rarely covers its tracks deeply','2020-08-19 15:43:19',NULL),(1006,'An.7','NontrivialDLLEP','Anomalies','This PE is a DLL with a nontrivial entry point. This is common among DLLs, but a malicious DLL may use its entry point to take up residence in a process','2020-08-19 15:43:19',NULL),(1007,'An.8','PossibleBAT','Anomalies','This object contains evidence of having a standard windows batch file included. Malware does this to avoid common scanning techniques and to provide persistence','2020-08-19 15:43:19',NULL),(1008,'An.9','PossibleDinkumware','Anomalies','This object shows evidence of including some components from DinkumWare. Dinkumware is frequently used in various malware components','2020-08-19 15:43:19',NULL),(1009,'An.10','RaiseExceptionImports','Anomalies','This object imports functions used to raise exceptions within a program. Malware does this to implement tactics that make standard dynamic code analysis difficult to follow','2020-08-19 15:43:19',NULL),(1010,'An.12','RWXSection','Anomalies','This PE may contain modifiable code, which is at best unorthodox and at worst symptomatic of a virus infection. Frequently, this feature implies that the object has been built using something other than a standard compiler, or has been modified after it was originally built','2020-08-19 15:43:19',NULL),(1011,'An.13','SuspiciousPDataSection','Anomalies','This PE is hiding something in its \"pdata\" area, and we\'re not sure what. The pdata section in a PE file is generally used for process runtime structures, but this particular object contains something else','2020-08-19 15:43:19',NULL),(1012,'An.14','SuspiciousRelocSection','Anomalies','This PE is hiding something in its \"relocations\" area, and we\'re not sure what. The relocations area in a PE file is generally used for relocating particular symbols, but this particular object contains something else','2020-08-19 15:43:19',NULL),(1013,'An.15','VersionAnomaly','Anomalies','This object has issues with how it presents its version information. Malware does this to avoid detection','2020-08-19 15:43:19',NULL),(1014,'An.11','ResourceAnomaly','Anomalies','This object contains an anomaly in the resource section. Malware frequently contains malformed or other odd bits in the resource section of a DLL','2020-08-19 15:43:19',NULL),(1015,'An.16','AutoitDbgPrivilege','Anomalies','AutoIt script is capable of performing debug activities','2020-08-19 15:43:19',NULL),(1016,'An.17','AutoitManyDllCalls','Anomalies','AutoIt script uses many external dll calls. AutoIt runtime already has many common functions, therefore using additional functionalit