spicious VBA code','2020-08-19 15:43:19',NULL),(1077,'An.78','SuspiciousVBALib','Anomalies','Reports suspicious VBA library usage','2020-08-19 15:43:19',NULL),(1078,'An.79','SuspiciousVBANames','Anomalies','Reports suspicious names associated with VBA structures','2020-08-19 15:43:19',NULL),(1079,'An.80','SuspiciousVBAVersion','Anomalies','Reports suspicious VBA versioning','2020-08-19 15:43:19',NULL),(1080,'An.81','SWFOddity','Anomalies','Reports certain usages of embedded SWF','2020-08-19 15:43:19',NULL),(1081,'An.82','TooMalformedToProcess','Anomalies','Document is so malformed that it could not be parsed completely','2020-08-19 15:43:19',NULL),(1082,'An.83','SuspiciousMetadata','Anomalies','Reports suspicious metadata','2020-08-19 15:43:19',NULL),(1083,'Co.1','BrowserInfoTheft','Collection','This object contains evidence of an intent to read passwords stored in browser caches. Malware uses this to collect the passwords for exfiltration','2020-08-19 15:43:19',NULL),(1084,'Co.2','CredentialProvider','Collection','This object contains evidence of interaction with a credential provider, or the desire to appear as one. Malware does this as credential providers get access to many types of sensitive data, such as usernames and passwords, and by acting as one they may be able to subvert the authentication integrity','2020-08-19 15:43:19',NULL),(1085,'Co.3','CurrentUserInfoImports','Collection','This object imports functions that are used to gather information about the currently logged in user. Malware uses this to determine paths of action to escalate privileges and to better tailor attacks','2020-08-19 15:43:19',NULL),(1086,'Co.4','DebugStringImports','Collection','This object imports functions that are used to output debug strings. Typically this is disabled in production software, but left on in malware that is being tested','2020-08-19 15:43:19',NULL),(1087,'Co.5','DiskInfoImports','Collection','This object imports functions that can be used to gather details about