ine itself. Malware uses this capability to better target further attacks or scan for new targets','2020-08-19 15:43:19',NULL),(1095,'Co.13','KeystrokeLogImports','Collection','This object imports functions that can capture and log keystrokes from the keyboard. Malware uses this to capture and save keystrokes to find sensitive information such as passwords','2020-08-19 15:43:19',NULL),(1096,'Co.14','OSInfoImports','Collection','This object imports functions that are used to gather information about the current operating system. Malware uses this to determine how to better tailor further attacks and to report information back to a controller','2020-08-19 15:43:19',NULL),(1097,'Co.15','PossibleKeylogger','Collection','This object contains evidence of keylogger type activity. Malware uses keyloggers to collect sensitive information from the keyboard','2020-08-19 15:43:19',NULL),(1098,'Co.16','PossiblePasswords','Collection','This object has evidence of including common passwords, or structure that would enable brute forcing common passwords. Malware uses this to attempt to further penetrate a network by accessing other resources via password','2020-08-19 15:43:19',NULL),(1099,'Co.17','ProcessorInfoWMI','Collection','This object imports functions that can be used to determine details about the processor. Malware uses this to tailor attacks and exfiltrate this data to common command and control infrastructure','2020-08-19 15:43:19',NULL),(1100,'Co.18','RDPUsage','Collection','This object shows evidence of interacting with the Remote Desktop Protocol insert into CYCategory values(\'RDP). Malware frequently uses this to move laterally and to offer direct command and control functionality','2020-08-19 15:43:19',NULL),(1101,'Co.19','SystemDirImports','Collection','This object imports functions used to locate the system directory. Malware does this to find where many of the installed system binaries are located, as it frequently hides among them','2020-08-19 15:43:19',NULL),(